import Link from "next/link";
import Logo from "./Logo.js";

const Header = () => (
  <div className="header-container">
    <Link href="/">
      <img className="social-icon-pic" src="/img/logo.jpg" alt="logo" />
    </Link>
    {style}
  </div>
);

const style = (
  <style jsx>{`
    .header-container {
      height: 5rem;
      display: flex;
      justify-content: space-between;
      position: fixed;
      top: 0;
      width: 100%;
      z-index: 400;
    }
  `}</style>
);

export default Header;
